        try {
            const res = await fetch('/getdata', {
                method: "GET",
                headers: {
                    "Content-Type": "application/json"
                },
            });

            const data = await res.json();
            console.log(data);
            setUserData({...userData,orgname:data.orgname, jobtitle:data.jobtitle, salary:data.salary ,location:data.location });

